/*Table structure for table `ngos` */

DROP TABLE IF EXISTS `ngos`;

CREATE TABLE `ngos` (
  `nid` int NOT NULL AUTO_INCREMENT,
  `nname` varchar(20) DEFAULT NULL,
  `ncon` varchar(20) DEFAULT NULL,
  `naddr` varchar(20) DEFAULT NULL,
