/*Table structure for table `payment` */

DROP TABLE IF EXISTS `payment`;

CREATE TABLE `payment` (
  `pid` int NOT NULL,
  `did` int DEFAULT NULL,
  `nid` int DEFAULT NULL,
  `amt` double DEFAULT NULL,
  `gender` enum('''Male"','"Female"') DEFAULT NULL,
  PRIMARY KEY (`pid`),
  KEY `did` (`did`),
  KEY `nid` (`nid`),
  CONSTRAINT `payment_ibfk_1` FOREIGN KEY (`did`) REFERENCES `donor` (`did`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `payment_ibfk_2` FOREIGN KEY (`nid`) REFERENCES `ngos` (`nid`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

/*Data for the table `payment` */

/*Table structure for table `paymentdata` */

DROP TABLE IF EXISTS `paymentdata`;

CREATE TABLE `paymentdata` (
  `pid` int NOT NULL AUTO_INCREMENT,
  `ngo_name` varchar(20) DEFAULT NULL,
  `full_name` varchar(20) DEFAULT NULL,
  `email` varchar(20) DEFAULT NULL,
  `gender` varchar(20) DEFAULT NULL,
  `amt` int DEFAULT NULL,
  `pdate` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`pid`)
) ENGINE=InnoDB AUTO_INCREMENT=23 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

